// Utils
import Banner from "../utils/Banner.jsx";
import ButtonUp from "../utils/ButtonUp";



const Home = () => {
	//Loadong & Skeleton
	const [isLoading, setIsLoading] = useState(true)
	setTimeout(()=> {
		setIsLoading(false)
	}, 1000);


    return (
        <main
            id="home"
            className="bg-site min-h-screen bg-cover overflow-hidden"
        >
            <NavbarDate />
            <Banner />
            <SearchMovie />
            <MovieUpcoming />
            <MovieTrending />
            <MoviePopular />
            <ButtonUp />
        </main>
    );
};

export default Home;
